import './ExerciseList.scss';
import Exercise from './Exercise';
import { useEffect, useState } from 'react';
import TrashCan from './TrashCan.js';

function ExerciseList() {

  const [list, setList] = useState([]);
  useEffect(()=>{
    fetch('http://localhost:3000/workouts')
      .then(response => response.json())
      .then(setList);
  }, []);

  return (
    <div className="ExerciseList">
            <table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Type</th>
            <th>Timing</th>
            <th>Target Area</th>
          </tr>
        </thead>
        <tbody>
          { 
          list.map(item =>
            <>
              <Exercise 
                key={ item.id }
                id={ item.id } 
                name={ item.name } 
                type={ item.type } 
                timing={ item.timing } 
                target={ item.target } 
              />
              <TrashCan id={ item.id } />
            </>
          ) }
        </tbody>
        </table>

        <br />
        <br />

        <iframe name="dummyframe" id="dummyframe"></iframe>


        <form action="http://localhost:3000/workouts" method="POST" target="dummyframe">
          <input type="text" id="id" name="id" placeholder="Id" /> 
          &nbsp;&nbsp;
          <input type="text" id="name" name="name" placeholder="Name" />
          &nbsp;&nbsp;          
          <input type="text" id="type" name="type" placeholder="Type" />
          &nbsp;&nbsp;         
          <input type="text" id="timing" name="timing" placeholder="Timing" />
          &nbsp;&nbsp;
          <input type="text" id="target" name="target" placeholder="Target" />
          &nbsp;&nbsp;
          <br />
          <br />
          <input type="submit" placeholder="Submit" />
        </form> 

    </div>
  );
}

export default ExerciseList;
